import { supabase } from './supabase';
import { QualityParameters } from '../utils/types';

export async function getEntriesPendingQuality() {
  return supabase
    .from('fabric_entries')
    .select('*')
    .eq('status', 'PENDING_QUALITY');
}

export async function addQualityParameters(fabric_entry_id: string, params: Omit<QualityParameters, 'id' | 'fabric_entry_id' | 'created_at'>) {
  return supabase.from('quality_parameters').insert([{ ...params, fabric_entry_id }]);
}

export async function updateQualityParameters(id: string, params: Partial<QualityParameters>) {
  return supabase.from('quality_parameters').update(params).eq('id', id);
}
